function wppfmAddToQueueString(e){var p=jQuery("#wppfm-feed-list-page-data-storage");wppfmQueueStringIsEmpty()?p.data("wppfmFeedsInQueue",e.toString()):p.data("wppfmFeedsInQueue",p.data("wppfmFeedsInQueue")+","+e.toString())}function wppfmRemoveFromQueueString(e){var p=jQuery("#wppfm-feed-list-page-data-storage"),t=p.data("wppfmFeedsInQueue");"string"==typeof t&&t.indexOf(",")>-1?(t=t.endsWith(e)?t.replace(e,""):t.replace(e+",",""),p.data("wppfmFeedsInQueue",t)):wppfmClearQueueString()}function wppfmQueueStringIsEmpty(){return jQuery("#wppfm-feed-list-page-data-storage").data("wppfmFeedsInQueue").length<1}function wppfmClearQueueString(){jQuery("#wppfm-feed-list-page-data-storage").data("wppfmFeedsInQueue","")}